	this.toPrecision=function(value,length){
		var v=value.toPrecision(length).toString();
		if (v.length>length){
			if (2*length-1>v.length){
				v=value.toPrecision(2*length-v.length).toString();
			}else{
				v=value.toPrecision(1).toString();
			}
		}
		v=v.replace(/(\.0*$)/,"");
		if (v.indexOf(".")>0&&v.indexOf("e")<0) v=v.replace(/(0*$)/,"");
		if (v.indexOf(".")>0&&v.indexOf("e")>0) v=v.replace(/(0*e)/,"e").replace(".e","e");
		if (NumberPoint!="."){
			v=v.replace(".",NumberPoint);
		}
		return v;
	}

