	//存取设置
	this.SaveSetting= function(SettingName,value){
		try{
			System.Gadget.Settings.write(SettingName,value+1);
		}catch(err){}
	}
	this.ReadSetting= function(SettingName,Default){
		var value;
		try{
			value=System.Gadget.Settings.read(SettingName);
		}catch(err){value=Default+1;}
		if (!value) {value=Default;}
		else value-=1;
		return value;
	}
	//滚轮
	this.mousewheel=function(roller){
		var L=Unit.GetRollerItemNumber("");
    	if(roller=="A"){
    		if (event.wheelDelta == 0){return 0;}
    		if (event.wheelDelta > 0){SelectedUnitA-=1;}
			if (event.wheelDelta < 0){SelectedUnitA+=1;}    			
			SelectedUnitA=Unit.FixPositionNumber(SelectedUnitA,L);
			Unit.ShowTip(unitArray[SelectedUnitType].data[SelectedUnitA].name);
			Unit.UnitChangeA();
    		Unit.setPosition("A",SelectedUnitA,0,L);
        }
    	if(roller=="B"){
    		if (event.wheelDelta == 0){return 0;}
    		if (event.wheelDelta > 0){SelectedUnitB-=1;}
			if (event.wheelDelta < 0){SelectedUnitB+=1;}    			
			SelectedUnitB=Unit.FixPositionNumber(SelectedUnitB,L);
			Unit.ShowTip(unitArray[SelectedUnitType].data[SelectedUnitB].name);
			Unit.UnitChangeB();
    		Unit.setPosition("B",SelectedUnitB,0,L);
        }
	}
